        Placebo (Musical Group)
[______________________________________]
Placebo are an English rock band, formed in London in 1994 by singer-guitarist Brian Molko and guitarist-bassist Stefan Olsdal. 
The band were soon joined by drummer Robert Schultzberg, who was replaced in 1996 by Steve Hewitt.
Hewitt left the band in 2007 and was replaced by Steve Forrest in 2008.
Placebo utilise androgynous images and musical content. To date, they have released seven studio albums,
all of which have reached the top 20 in the United Kingdom,and have sold around 11 million records worldwide
